import React from 'react';

function SearchBar() {
  function onChangeValue(event) {
    console.log(event.target.value);
  }

  return (
    <div>
      <div onChange={ (event) => onChangeValue(event) }>
        <input type="radio" value="Ingredientes" name="foods" />
        {' '}
        Ingredientes
        <input type="radio" value="Nome" name="foods" />
        {' '}
        Nome
        <input type="radio" value="Primeira letra" name="foods" />
        {' '}
        Primeira letra
      </div>
      <div>
        <button
          type="button"
          data-testid="exec-search-btn"
        >
          Buscar
        </button>
      </div>
    </div>

  );
}

export default SearchBar;
